CREATE SCHEMA example;

CREATE TABLE example.airports (
    airport_id integer,
    name character varying(256),
    city character varying(512),
    country character varying(512),
    iata_faa character varying(3),
    icao character varying(6),
    latitude numeric(9,6),
    longitude numeric(9,6),
    altitude numeric(9,3),
    timezone integer,
    dst character varying(128),
    tz character varying(256)
);

CREATE TABLE example.machines (
    id integer,
    model character varying(64),
    age integer,
    status character varying(64),
    latitude numeric(9,6),
    longitude numeric(9,6)
);

CREATE TABLE example.trips (
    trip_id integer,
    reason character varying(256),
    origin character varying(3),
    destination character varying(3),
    departure_date date,
    arrival_date date
);


